import React from "react";
import Joke from "./Joke";
import jokesData from "./jokesData";

function App() {
  const jokeComponents = jokesData.map((joke) => (
    <Joke question={joke.question} punchLine={joke.punchLine} />
  ));

  return (
    <div className="Jokes">
      <Joke bar={{ punchLine: "haha gotta ya!" }} />
      <Joke bar={{ question: "Knock Knock?", punchLine: "Who is there." }} />
      <Joke bar={{ question: "Guess What?", punchLine: "Nothing." }} />
      <Joke bar={{ question: "Yup?", punchLine: "Better." }} />
      <Joke bar={{ question: "Who?", punchLine: "Serve." }} />
    </div>
  );
}

export default App;

/** map function example
   map returns a new array with the transformed data */
const nums = [1, 2, 3, 4, 5, 6, 7, 8, 8, 10];
const doubled = nums.map((num) => num * 2);
console.log(doubled);
